    "Moose movement and distribution in response to winter seismological exploration
    on the Kenai National Wildlife Refuge, Alaska",nt"tracking_summary": {ntt"total":
    5,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:23.196597",nt"name": "moose-movement-and-distribution-in-response-to-winter-seismological-exploration-on-the-ken",nt"isopen":
    false,nt"url": null,nt"notes": "Although oil and gas development first
    occurred in Alaska on the Kenai National Wildlife Refuge (KNWR) in 1957, impacts
    on wildlife from oil exploration and subsequent development were not studied. In
    anticipation of more extensive use of refuge lands for non-wildlife-oriented commercial
    activities, it was recognized that wildlife monitoring should accompany or precede
    exploration and development. Two potential areas for new oil and gas discoveries
    on the Kenai Peninsula encompassed the two important moose (Alces alces) wintering
    areas on the KNWR. Since ungulates are vulnerable to disturbance during the winter
    and moose are an important big game species on the KNWR a study was developed by
    the KNWR and funded by Atlantic Richfield Company (ARCO) and Cook Inlet Region Incorporated
    (CIRI) to investigate the impacts of seismic exploration on overwintering moose.
    Results of the study should assist land managers in making timely and informed decisions
    about commercial non-wildlife oriented refuge uses.",nt"license_title": "License
